import React, { useEffect } from "react"
import CollectionPreview from "./collection-preview-style"
import { useSelector, useDispatch } from "react-redux"
import { selectShopCollectionsMap } from "../../redux/shop/shop.selectors"
import { fetchCollectionsStart } from "../../redux/shop/shop.actions"
import CollectionItem from "../collection-Item/CollectionItem"

const CollectionPreviewComponent = () => {
    const collections = useSelector(state => selectShopCollectionsMap(state))
    const dispatch = useDispatch()
    useEffect(() => {
        dispatch(fetchCollectionsStart())
    }, [])

    return <CollectionPreview>
        <div classNAme="collection-container">
            {collections.map(collection =>
                <CollectionItem object={collection} />)}
        </div>

    </CollectionPreview>
}
export default CollectionPreviewComponent
